/* src/pages/PackagePage.jsx */
import React from "react";
import { useLocation } from "react-router-dom";
import styled from "styled-components";
import { FaRegCalendarCheck } from "react-icons/fa";

const Wrap = styled.div`max-width:880px;margin:2rem auto;padding:0 1rem;`;
const HeaderImg = styled.img`width:100%;border-radius:22px;height:320px;object-fit:cover;`;
const TwoCol = styled.div`display:grid;gap:2rem;margin-top:1.8rem;
  grid-template-columns:2fr 1fr;`;
const Card = styled.div`padding:1.4rem 1.6rem;border-radius:18px;background:#fff;
  box-shadow:0 6px 18px rgba(0,0,0,.12);`;
const Price = styled.h2`margin:0;color:#175dff;`;
const Btn = styled.button`
  width:100%;padding:.9rem;margin-top:1.2rem;border:none;border-radius:10px;
  background:linear-gradient(135deg,#0048ff,#167dff);color:#fff;font-weight:600;
  cursor:pointer;`;

export default function PackagePage(){
  const { state:pkg } = useLocation();          // package object passed via navigate

  if(!pkg) return <Wrap>Nothing to show.</Wrap>;

  return (
    <Wrap>
      <HeaderImg src={pkg.thumb} />

      <TwoCol>
        {/* left – breakdown */}
        <Card>
          <h2>{pkg.hotel.title}</h2>
          <p><FaRegCalendarCheck/> {pkg.nights} nights, {pkg.hotel.city}</p>

          <h3>Hotel</h3>
          <ul>
            <li>{pkg.hotel.starRating}★ - {pkg.hotel.address}</li>
            <li>€ {pkg.hotel.pricePerNight} × {pkg.nights} nights</li>
          </ul>

          <h3>Flight</h3>
          <ul>
            <li>{pkg.flight.airline}</li>
            <li>Depart: {new Date(pkg.flight.departureTime).toLocaleString()}</li>
            <li>Return: {new Date(pkg.flight.arrivalTime).toLocaleString()}</li>
            <li>€ {pkg.flight.price}</li>
          </ul>

          <h3>Event</h3>
          <ul>
            <li>{pkg.event.title} – {pkg.event.venue}</li>
            <li>{new Date(pkg.event.eventDate).toLocaleString()}</li>
            <li>€ {pkg.event.price}</li>
          </ul>
        </Card>

        {/* right – booking widget */}
        <Card>
          <Price>Total € {pkg.total.toFixed(0)}</Price>
          <label style={{display:"block",marginTop:"1rem"}}>
            Guests&nbsp;
            <input type="number" min={1} defaultValue={2}
              style={{width:60,padding:".3rem .4rem"}}/>
          </label>
          <Btn onClick={()=>alert("✅  Demo: booking placed!")}>
            Book now
          </Btn>
        </Card>
      </TwoCol>
    </Wrap>
  );
}
